import random
import math

SIZE = 10
N_REP = 100

EQ = {'a': -1, 'b': -4, 'c': 5} # x² + 2x + 1

def delta(eq):
    return pow(eq['b'], 2) - (4 * eq['a'] * eq['c'])

def bhaskara(eq):
    d = delta(eq)

    x1 = (-eq['b'] + math.sqrt(d)) / (2 * eq['a'])
    x2 = (-eq['b'] - math.sqrt(d)) / (2 * eq['a']) 

    return (x1, x2)

def gen_pop():
    pop = [(round(random.uniform(-20, 20),2),round(random.uniform(-20, 20),2)) for _ in range(SIZE)]

    return pop

def fitness(z, t, eq):
    fit1 = (eq['a'] * pow(z, 2)) + (z * eq['b']) + eq['c']
    fit2 = (eq['a'] * pow(t, 2)) + (t * eq['b']) + eq['c']

    return round((abs(fit1)+abs(fit2))/2, 2)

def sort_pop(pop, fitness):
    sorted_pop = [(pop[i], fitness[i]) for i in range(len(pop))]
    sorted_pop.sort(key=lambda s: s[1])
    sorted_pop = [i[0] for i in sorted_pop]

    return sorted_pop[:10]

def crossover(pop):
    pop_copy = [p for p in pop]
    
    for i in range(len(pop) // 2):
        r = random.randint(0, 100)
        if r >= 60:
        
            pos1 = random.randint(0, 1)
            pos2 = random.randint(0, 1)
            
            f1 = (pop[i][pos1], pop[i+5][pos2])

            if (pos1 == 0):
                pos1 += 1
            else:
                pos1 -= 1

            if (pos2 == 0):
                pos2 += 1
            else:
                pos2 -= 1

            f2 = (pop[i][pos1], pop[i+5][pos2])

            pop_copy.append(f1)
            pop_copy.append(f2)
            # print(f'i: {i}, j: {j}')
    
    return pop_copy

def mutation(pop):
    pop_copy = [p for p in pop]

    for i in range(5):
        
        r = random.randint(0, 100)
        if r >= 60:
            # pos = random.randint(0, 1)
            v = random.uniform(0, 1)
            a, b = pop[i]

            fit1 = fitness(a, a, EQ)
            fit2 = fitness(b, b, EQ)
            if fit1 > fit2:
                pos = 0
            else:
                pos = 1

            if pos == 0:
                if a < 0:
                    f = (a-v, b)
                else:
                    f = (a+v, b)
            else:
                if b < 0:
                    f = (a, b-v)
                else:
                    f = (a, b+v)

            pop_copy.append(f)

    return pop_copy

if __name__ == '__main__':
    pop = gen_pop()

    print("População Inicial:")
    print(pop)
    
    overall_fitness = [fitness(ind[0], ind[1], EQ) for ind in pop]
    pop = sort_pop(pop, overall_fitness)

    for _ in range(N_REP):
        # pop = crossover(pop)
        pop = mutation(pop)
        overall_fitness = [fitness(ind[0], ind[1], EQ) for ind in pop]

        pop = sort_pop(pop, overall_fitness)

    pop = [(round(ind[0], 2), round(ind[1], 2)) for ind in pop] # Arredonda os resultados para 2 casas decimais

    print(f"\nPopulação após {N_REP} repetições:")
    print(pop)

    print(f"\nSolução ótima: {bhaskara(EQ)}\nMelhor solução encontrada: {pop[0]}")

