#include <stdio.h>

int main ()
{
    printf("Enter the number of processes: ");
    int processes;
    scanf("%d", &processes);

    int bursttime[processes];
    printf("Enter the burst times: ");
    for(int i = 0; i < processes; i++)
    {
        scanf("%d", &bursttime[i]);
    }

    for(int i = 0; i < processes; i++)
    {
        for(int j = i + 1; j < processes; j++)
        {
            if(bursttime[i] > bursttime[j]) 
            {
                int temp = bursttime[i];
                bursttime[i] = bursttime[j];
                bursttime[j] = temp;
            }
        }
    }

    int waitingTime[processes];
    waitingTime[0] = 0;
    int totalWaitingTime = 0;

    for(int i = 1; i < processes; i++)
    {
        waitingTime[i] = 0;
        for(int j = 0; j < i; j++)
        {
            waitingTime[i] += bursttime[j];
        } 
        totalWaitingTime += waitingTime[i];
    }

    float avgWaitingTime = (float)totalWaitingTime / (float)processes;


    int TAT[processes];
    int totalTAT = 0;

    for(int i = 0; i < processes; i++)
    {
        TAT[i] = bursttime[i] + waitingTime[i];
        totalTAT += TAT[i];
    }

    float avgTAT = (float)totalTAT / (float)processes;

    printf("P\tBT\tWT\tTAT\n");

    for(int i = 0; i < processes; i++)
    {
        printf("P%d\t", i + 1);
        printf("%d\t%d\t%d\n", bursttime[i], waitingTime[i], TAT[i]);
    }

    printf("Average Waiting Time: %f\n", avgWaitingTime);
    printf("Average Turn Around Time: %f", avgTAT);
}

